import './App.css';
import HomePage from './containers/HomePage';
import {BrowserRouter as Router, Route,Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/"  element={<HomePage/>}/>
          <Route exact path="/"  element={<Product/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
